import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Test } from "./pages";

function App() {
  return (
    <BrowserRouter>
        <Header />

        <main>
          <Routes>
            <Route path="/" element={<Test />}></Route>

          </Routes>
        </main>
      </BrowserRouter>
  );
}

export default App;
